	
	function play(url)
	{
			
		var number = 3;		
		var music = document.getElementById('audio');
		console.log("play")
		if(url)
		{
			music.src = url;
		}
		music.dataset.state = "play";
		music.play();

			
		music.addEventListener('error',function () {
			var timeout  = setTimeout(function() {

				if(number==1)
				{
					clearTimeout(timeout);
					var notification = webkitNotifications.createNotification(
					  'data:image/png;base64,', 
					  'Ой! Что-то пошло не так', 
					  'Возможно отсутствует соединение с интернетом либо возникли проблемы на сайте.'

					);
					notification.show();
					setTimeout(function() {	
						notification.cancel();
					},4000)
				}
				number--;
				music.play()
			},500)
			return false;
		})
		return music.src;
	}
	function stop () {
		var music = document.getElementById('audio');

		music.dataset.state = "pause";
		music.pause();
	}
	function volume (size) {
		var music = document.getElementById('audio');
		music.volume = size;
	}
	function get_audio () {
		return document.getElementById('audio');
	}